export enum ProstheticPlacement {
    VeryBack, BehindHead, BaseHead, UnderHair, VeryFront
}

class ProstheticCatalog {

    private static _instance: ProstheticCatalog;

    public static get instance() {
        if (ProstheticCatalog._instance == null) {
            ProstheticCatalog._instance = new ProstheticCatalog();
        }
        return ProstheticCatalog._instance;
    }

    getProsthetic(token: Token, placement: ProstheticPlacement) {
        if (token.species === Species.Andorian) {
            switch (placement) {
                case ProstheticPlacement.BehindHead:
                    return AndorianAntenna.back.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                case ProstheticPlacement.VeryFront:
                    switch (token.hairType) {
                        case HairType.SidePart:
                        case HairType.TousledSidePart:
                        case HairType.BowlCutHair:
                        case HairType.RomulanPeakedHair:
                        case HairType.ChinLengthBob:
                        case HairType.MediumLengthFemaleSidePart:
                        case HairType.MediumMaleCenterPart:
                        case HairType.ShortTeasedOverEyeStyle:
                        case HairType.PinnedUpHairWithPart:
                        case HairType.CentrePart:
                        case HairType.UpsweptWithProduct:
                            return AndorianAntenna.frontCovered.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);

                        case HairType.FeminineDreadStyle:
                        case HairType.ShoulderLengthBob:
                        case HairType.ChinLengthCombBack:
                            return AndorianAntenna.frontCoveredMore.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                        default:
                            return AndorianAntenna.front.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                    }
                default:
                    return "";
            }
        } else if (token.species === Species.Klingon) {
            if (placement === ProstheticPlacement.BaseHead) {
                switch (token.speciesOption) {
                    case SpeciesOption.Option1:
                        return KlingonForehead1.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                    case SpeciesOption.Option2:
                        return KlingonForehead2.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                    case SpeciesOption.Option3:
                        return KlingonForehead3.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                    case SpeciesOption.Option4:
                        return KlingonForehead4.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                    case SpeciesOption.Option5:
                        return KlingonForehead5.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                    case SpeciesOption.Option6:
                        return svgTranslationHelper(KlingonForehead6.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor));
                    default:
                        return "";
                }
            }
        } else if (token.species === Species.Haliian) {
            if (placement === ProstheticPlacement.BaseHead) {
                return HaliianForehead.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
            }
        } else if (token.species === Species.Napean) {
            if (placement === ProstheticPlacement.BaseHead) {
                return svgTranslationHelper(NapeanForehead.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor));
            }
        } else if (token.species === Species.Tellarite && token.speciesOption === SpeciesOption.Option2) {
            if (placement === ProstheticPlacement.VeryFront) {
                return TellariteTusks.front.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
            } else if (placement === ProstheticPlacement.VeryBack) {
                return TellariteTusks.back.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
            }
        } else if (token.species === Species.Aurelian) {
            switch (placement) {
                case ProstheticPlacement.VeryBack:
                    return AurelianWings.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
                default:
                    return "";
            }
        } else {
            return "";
        }
    }

}

export default ProstheticCatalog;